import React, { Component } from 'react';
import { Layout, Row, Col, 	Card, BackTop } from 'antd';

import HeaderNav from '@/components/home/header/headerNav';
import Header from '@/components/home/header/header';
import LeftModule from '@/components/home/content/leftModule';
import CenterModule from '@/components/home/content/centerModule';
import Footer from '@/components/home/footer/footer';
import "animate.css";
const { Panel } = Collapse;
const TabPane = Tabs.TabPane;
class Profile extends Component {
  render() {

    return (

      <div>
 <HeaderNav></HeaderNav>
 <Row>
 <Col span={9}> </Col>
 <Col span={7}>

 <Tabs>
   <TabPane tab="My favoutire" key="1"> </TabPane>
   <TabPane tab="My Review" key="2"> </TabPane>
   <TabPane tab="My Photo" key="3"> </TabPane>
 </Tabs>
 </Col>
 <Col span={8}>             <LeftModule/> </Col>

 </Row>
 <PCFooter></PCFooter>
 </div>

    )
  }
}


export default Profile
